INSERT INTO `cerita` (`id`, `icon`, `show_this`, `judul`, `pengarang`, `isi`) VALUES
(1, , 1, 'Si Bebek Buruk Rupa', 'Hans Christian Andersen', '<p>\r\nDahulu kala, adalah sekelompok bebek yang tinggal di tepi sungai. Mereka terdiri terdiri dari Pak Bebek, Ibu Bebek, dan telur-telur bebek yang sedang dierami oleh Ibu Bebek. Suatu hari telur-telur itu menetas satu persatu. Pak Bebek senang bukan main, Ibu Bebek pun demikian. Sambil memperhatikan telur-telur yang menetas satu persatu, ia pun tersenyum dan memeluk satu persatu anak bebek yang sudah lahir itu. Namun pada telur yang terakhir menetas, yang keluar bentuknya sangat berbeda dengan saudara-saudaranya. Bila Ibu dan Pak Bebek berwarna kuning keemasan dan berparuh oranye serta berbunyi “Kweek..kweek..” maka anak bebek yang terakhir ini berbulu kehitaman dan berparuh kecoklatan, wajahnya tidak secantik saudara-saudaranya, dan suaranya pun berbeda, “Ooork..ooork…”</p>\r\n\r\n<p>\r\nPak dan Ibu bebek pun bertengkar hebat. Pak bebek merasa anak itu adalah hasil perselingkuhan Ibu bebek dengan mahluk lain, sedangkan Ibu bebek tidak terima dituduh seperti itu. Pak bebek pun pergi meninggalkan Ibu bebek. Sementara itu si bebek kecil yang buruk rupa tadi pun diejek oleh saudara-saudaranya yang lain.</p>\r\n\r\n<p>\r\n Namun demikian, si bebek kecil yang buruk rupa itu tetap mengikuti kemanapun induknya pergi, walaupun induknya tidak pernah sekalipun memperhatikannya. Semakin besar, semakin berbedalah dia dengan saudara-saudaranya yang lain, dan hal ini sangat memalukan bagi Ibu bebek. Apalagi si bebek buruk rupa ini ternyata tidak bisa berenag sebaik saudara-saudaranya yang lain. Pada suatu hari, saat sedang berenang bersama Ibu dan saudara-saudaranya, sang bebek buruk rupa ini tertinggal jauh di belakang.. Ia kemudian memanggil-manggil ibunya dengan suaranya yang jelek itu, namun tidak ada sahutan..\r\nAkhirnya ia pun berenang menyusuri sungai untuk mencari keluarganya kembali, berhari-hari ia lalui tanpa menyerah, hujan angin ia terpa tanpa kenal lelah, hingga akhirnya ia benar-benar putus asa dan menangis sedih di sudut sungai. Tangisannya begitu meyayat hati, ia masih begitu kecil, belum mengerti mengapa ibunya meninggalkannya dan tidak pernah sayang padanya, padahal ia anaknya.. mengapa langit begitu kejam padanya, mengapa, tangisnya..</p>\r\n<p>\r\nTak lama, datanglah dua ekor bebek yang ajaibnya, sama buruknya dengan bebek buruk rupa itu, bahkan suaranya pun juga sama! Mereka mendatangi bebek kecil yang sedang menangis itu dan menghiburnya. Tak lama, datanglah induk mereka yang mencari kedua anaknya yang tiba-tiba menghilang, dan terlihatlah oleh bebek buruk rupa itu seekor angsa yang sangat cantik.. lehernya panjang… dan wajahnya menyiratkan kasih dan sayang</p>\r\n\r\n<p>Begitu melihat bebek buruk rupa itu, ia pun bertanya padanya:</p>\r\n<p>Wahai mahluk kecil, mengapa engkau menangis?</p>\r\n<p>Saya kehilangan induk saya\" jawab si bebek sambil menangis.. “Induk saya tidak mau saya lagi..karena saya berbeda dengan saudara-saudara saya.. mereka cantik-cantik dan pandai berenang seperti saudara-saudara saya yang lain.. waktu baru lahir, saya sudah dibenci oleh ibu saya, karena saya tidak seperti mereka, dia tidak pernah menyayangi saya, katanya saya bukanlah anaknya karena bulu saya tidak kuning keemasan seperti mereka… paruh saya tidak sama warnanya dengan mereka.. dan suara saya sangat jelek. Ibu selalu berkata bahwa saya adalah bebek yang salah lahir..”\r\n“Wahai mahluk kecil, jangan menangis memang benar kata Ibu kamu, kamu berbeda dengan saudara-saudaramu yang lain.. mereka memiliki apa yang tidak kamu miliki dan sebaliknya kamu juga memiliki apa yang tidak mereka miliki</p>\r\n\r\n<p>Nah, sekarang lihatlah air yang mengalir di bawahmu, pandanglah wajahmu… lihatlah persamaan antara dirimu dan anak-anakku”\r\nSang itik pun melihat pantulan dirinya sendiri di air dan mendapati bahwa dirinya ternyata sama dengan kedua anak itik tersebut.\r\n“Ya, kamu bukanlah anak bebek, kamu adalah anak itik. Memang saat ini rupamu buruk, tetapi aku yakin kelak kamu akan menjadi secantik aku. Kemarilah nak, anggaplah aku ini Ibumu”</p>\r\n<p>Sang itik kecil itupun mendekati induk Angsa yang cantik dan merasakan kehangatan dibawah pelukan sayapnya yang penuh dengan kasih. Ia pun tak lagi bersedih. Kemudian sang itik kecil pun ikut bersama dengan induk angsa kemanapun mereka berenang, sekarang sebagai itik yang bangga, karena ia mempunyai keluarga yang menyayanginya dan pada suatu kesempatan, ia berpapasan dengan keluarga bebek yang pernah membencinya, ia pun berasa bangga saat melewati mereka, dan anak-anak bebek itupun hanya terbengong-bengong saja melihatnya</p>');
INSERT INTO `cerita` (`id`, `icon`, `show_this`, `judul`, `pengarang`, `isi`) VALUES
(2, , 1, 'Rumplestiltskin ', 'the Brothers Grimm', '<p>Dahulu kala ada seorang penggiling gandum. Dia adalah laki-laki bodoh yang selalu berbicara tanpa berpikir panjang.</p>\r\n<p>Suatu hari, raja berkuda melintasi penggilingan bersama para pemburunya. Anak perempuan penggiling gandum itu sedang duduk memintal di pintu depan. Raja terpesona melihat kecantikan gadis itu sehingga dia mulai berbicara padanya. Ayahnya segera datang dan mulai mengatakan kepada raja betapa luar biasa putrinya itu.</p>\r\n<p><i class=“saying”>Wah, Yang Mulia, dia bahkan dapat memintal jerami jadi emas!</i> kata penggiling gandum itu.</p>\r\n<p>Gadis malang itu terdiam, dia tidak bisa melakukan hal seperti itu, tapi raja merasa itu adalah cara terbaik untuk mengisi kembali ruang harta istana yang sudah agak kosong. Jadi, dia membawa putri itu ke istana. Dia mengajak gadis itu ke dalam ruangan berisi setumpuk besar jerami dan menyuruhnya memintal semua jerami yang ada jadi emas. Kalau tidak, keesokan harinya akan ada hal buruk yang menimpanya.</p>\r\n<p>Segera setelah pintu dikunci, gadis itu mulai menangis. Tidak mungkin melakukan tugas itu. Tapi kemudian terdengarlah suara kecil.</p>\r\n<p><i class=“saying”>Berhentilah menangis! Kamu akan membuat semua jerami basah dan kita tidak akan bisa membuatnya menjadi emas!</i></p>\r\n<p>Di depan gadis itu berdiri laki-laki kecil aneh. Tubuhnya bulat keil, kakinya kurus panjang dengan telapak kaki yang besar. Bajunya sudah rusak dan dia memakai topi tua tingi di kepalanya.</p>\r\n<p><i class=“saying”>Kalau kamu berikan kalung, aku akan melakukan apa yang raja perintahkan,</i> ujarnya tidak sabar.</p>\r\n<p>Putri penggiling tepung melepaskan kalungnya dan memberikannya pada laki-laki itu. Laki-laki itu memasukkan kalung itu ke dalam salah satu sakunya dan duduk dekat alat pintal. Alat pintal mulai bekerja. Tumpukkan jerami jadi makin rendah, tapi gundukkan emas berkilau makin tinggi. Saat sinar matahari menembus jendela, semuanya sudah selesai.</p>\r\n<p>Laki-laki kecil aneh itu menghilang secepat kemunculannya.</p>\r\n<p>Raja senang melihat tumpukan emas yang tinggiitu dan dia melamar anak perempuan penggiling tepung itu. Gadis itu malu-malu untuk menjawabnya sehingga Raja menganggap sikap diamnya sebagai tanda setuju, kemudian mereka menikah siang itu juga.</p>\r\n<p>Untuk sementara semuanya berjalan baik. Tapi ketika ruang harta kosong lagi, sekali lagi gadis malang itu, yang sekarang menjadi ratu, dikunci dalam sebuah ruangan bersama setumpuk jerami dan alat pintal.</p>\r\n<p>Saat Ratu menangis, sekali lagi laki-laki kecil aneh itu datang padanya lagi. Ratu meminta bantuannya lagi dan menawarkan padanya seluruh permata mahal yang dienakannya. Tapi kali ini laki-laki kecil aneh itu tidak tertarik dengan perhiasaan.</p>\r\n<p><i class=“saying”>Kamu harus berjanji akan memberikan anak pertamamu kepadaku,</i> bisiknya.</p>\r\n<p>Ratu putus asa. Tapi dia berjanji dan laki-laki itu duduk dekat alat pintal. Tumpukan emas besar muncul di samping alat pintal, dan saat fajar, semua jerami itu telah hilang. Raja sangat senang dan untuk sementara semuanya baik. Kemudian Ratu melahirkan seorang bayi canti dan dia teringat akan janjinya yang menakutkan pada laki-laki itu muncul di dekat tempat tidur sang bayi. Ratu menangis tersedu-sedu.</p>\r\n<p><i class=“saying”>Kamu selalu begitu,</i> ujar laki-laki kecil dengan jengkel, <i class=“saying”>selalu menangis!</i></p>\r\n<p><i class=“saying”>Aku akan melakukan apa pun, tapi jangan ambil bayiku,</i> tangis ratu.</p>\r\n<p><i class=“saying”>Baik, kalau begitu, apa pun yang membuatmu berhenti menangis,</i > ujar laki-laki kecil itu, yang menjadi basah kuyup karena air mata Ratu.</p>\r\n<p><i class=“saying”>Kalau kamu bisa menebak namaku dalam tiga hari, aku akan biarkan kamu merawat bayi itu,</i> ujarnya dan dia menghilang secara tiba-tiba seperti kemunculannya.</p>\r\n<p>Esok paginya laki-laki kecil itu muncul kembali. Ratu mengutus orangnya ke segala penjuru untuk mengetahui nama laki-laki aneh itu.</p>\r\n<p><i class=“saying”>Apakah Lacelegs?</i”> tanyanya.</p>\r\n<p><i class=“saying”>Bukan!</i”></p>\r\n<p><i class=“saying”>Apakah Wimbleshanks?</i></p>\r\n<p><i class=“saying”>Bukan!</i></p>\r\n<p><i class=“saying”>Apakah Bandyknees?</i></p>\r\n<p><i class=“saying”>Bukan!</i></p>\r\n<p>Ratu mengutus lebih banyak orang lagi ke negeri-negeri yang jauh di perbatasan kerajaan. Pagi kedua laki-laki kecil itu muncul di samping buaian.</p>\r\n<p><i class=“saying”>Apakah namamu Bluenose?</i></p>\r\n<p><i class=“saying”>Bukan!</i></p>\r\n<p><i class=“saying”>Apakah Longtooth?</i></p>\r\n<p><i class=“saying”>Bukan!</i></p>\r\n<p><i class=“saying”>Apakah Skinnyribs?</i></p>\r\n<p><i class=“saying”>Tidak</i>, dan laki-laki itu menghilang sambil tertawa mengejek.</p>\r\n<p>Ratu menunggu sepanjang malam sementara utusannya datang satu per satu, dan saat hampir putus harapan untuk menyelamatkan bayinya yang begitu berharga, datanglah utusan terakhir. Utusan itu sangat lelah, tapi dia membawa kabar gembira untuk Ratu. Di hutan yang gelap dan panjang, dia melihat laki-laki kecil aneh sedang menari mengelilingi api unggun, menyanyikan lagu.</p>\r\n<p><i>Hari ini memasak, hari ini aku memanggang</i></p>\r\n<p><i>Esok hari aku akan membawa bayi. </i></p>\r\n<p><i>Ratu akan kalah dalam permainan ini, Rumpelstiltskin lah namaku!</i></p>\r\n<p>Laki-laki kecil aneh itu muncul di dekat buaian. Ratu berpura-pura masih belum mengetahui namanya.</p>\r\n<p><i class=“saying”>Apakah Gingerteeth?</i> tanyanya.</p>\r\n<p><i class=“saying”>Bukan!</i> ujar laki-laki kecil itu, sambil mengangkat bayi itu.</p>\r\n<p><i class=“saying”>Apakah Silverhair?</i> tanya ratu.</p>\r\n<p><i class=“saying”>Bukan!</i> ujar laki-laki kecil itu, dan dia mulai melangkah menuju pintu dengan senyum jahatnya.</p>\r\n<p><i class=“saying”>Apakah Rumpelstiltskin?</i> tanya Ratu, dan dia mengejar lak-laki kecil aneh itu.</p>\r\n<p><i class=“saying”>Pasti ada penyihir yang mengatakannya!</i> jerit laki-laki kecil itu, dan dia mengentakkan kakinya begitu keras sehingga jatuh menembus lantai dan tidak pernah terlihat lagi. Ratu menceritakan kepada Raja seluruh kisahnya dan Raja sangat senang bayi dan permaisurinya selamat sehingga dia lupa memarahi penggiling tepung itu karena telah berbohong sejak awal!</p>');

